import React, { Fragment, useState } from "react";
import './addMember.css';
import Navbar from "../components/navbar";
import notiIcon from '../images/icons8-notifications-64.png';
import settingsIcon from '../images/icons8-settings-50.png';
import menuIcon from '../images/icons8-menu-50.png';

const AddMember = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const [formData, setFormData] = useState({
        email: '',
        honorific: '',
        firstName: '',
        middleName: '',
        lastName: '',
        phoneNumber: '',
        address: '',
        city: '',
        state: '',
        medicalCouncilNumber: '',
        category: '',
        visitorType: '',
        packageId: '',
    });

    const handleChange = (event) => {
        const { name, value } = event.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        // Send form data to server
        axios.post('/api/addMember', formData)
            .then(response => {
                console.log('Member added successfully:', response.data);
                // Reset form data after successful submission
                setFormData({
                    email: '',
                    honorific: '',
                    firstName: '',
                    middleName: '',
                    lastName: '',
                    phoneNumber: '',
                    address: '',
                    city: '',
                    state: '',
                    medicalCouncilNumber: '',
                    category: '',
                    visitorType: '',
                    packageId: '',
                });
            })
            .catch(error => {
                console.error('Error adding member:', error);
            });
    };


    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    return (
        <Fragment>
            <div className="div_main_dashboard">
                <div className="dashboard_header_container">
                    <header className="dashboard_header">
                        <div className="header_left">
                            <img src={menuIcon} alt="Menu" className="menu-icon" onClick={toggleMenu} />
                            <h1>Add member</h1>
                        </div>
                    </header>
                </div>
                <Navbar isMenuOpen={isMenuOpen} toggleMenu={toggleMenu} />
                <div>

                </div>
            </div>
        </Fragment>
    );
}

export default AddMember;
